import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route, useParams} from 'react-router-dom';
import Profile from './pages/Profile.jsx';
import Main from './pages/Main.jsx';
import Calender from './pages/Calender.jsx';
import SavedFiles from './pages/SavedFiles.jsx';
import About from './pages/About.jsx';
import MailCard from './components/mail_list/MailCard.jsx';
import { list, baselist } from './components/mail_list/MailList.jsx';
import MailContent from './components/mail_list/MailContent.jsx';


function App() {
	let {userId} = useParams();
	return (
	<BrowserRouter>
		<Routes>
			<Route path="/" element={<Main mail={baselist}/> } />
			<Route path="/profile/" element={<Profile/> } />
			<Route path="/calender/" element={<Calender/>} />
			<Route path="/savedfiles/" element={<SavedFiles/>} />
			<Route path="/about/" element={<About/>} />
			<Route path="/mail/:userID"  element={<MailContent mail={list[{userID}]}/>}/>
		</Routes>
  	</BrowserRouter>
  );
}

export default App;
